var script_f34_58_35745=[" /* <![CDATA[ */",
"",
"",
"function log(i){",
"return Math.log(i) * Math.LOG10E;   ",
"}",
"",
"function ln(i){",
"return Math.log(i);",
"}",
"",
"function sq(i){",
"return i * i;",
"}",
"",
"function sqr(i){",
"return Math.sqrt(i);",
"}",
"",
"",
"function power(x,y){",
"return Math.pow(x,y);",
"}",
"",
"function eTo(x){",
"return Math.exp(x);",
"}",
"",
"",
"function fixDP(r, dps) {",
"if (isNaN(r)) return \"NaN\";",
"var msign = '';",
"if (r < 0) msign = '-';",
"x = Math.abs(r);",
"if (x > Math.pow(10, 21)) return msign + x.toString();",
"var m = Math.round(x * Math.pow(10, dps)).toString();",
"if (dps == 0) return msign + m;",
"while (m.length <= dps) m = \"0\" + m;",
"return msign + m.substring(0, m.length - dps) + \".\" + m.substring(m.length - dps);",
"}",
"",
"var currenttimeout;",
"",
"",
"var calctxt = ''; ",
"var xmltxt = ''; ",
"var htmtxt = ''; ",
"",
"",
"",
"function Kt_V_Daugirdas_fx() {",
"",
"currenttimeout = self.setTimeout('minMaxCheck();', 3000);",
"",
"with(document.Kt_V_Daugirdas_form){",
"",
"",
"doCalc = true;",
"if (BUN_Pre_param.value.indexOf(',') >= 0){ BUN_Pre_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(BUN_Pre_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = BUN_Pre_unit.options[BUN_Pre_unit.selectedIndex].value.split('|');",
"BUN_Pre = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"if (BUN_Post_param.value.indexOf(',') >= 0){ BUN_Post_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(BUN_Post_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = BUN_Post_unit.options[BUN_Post_unit.selectedIndex].value.split('|');",
"BUN_Post = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"if (Hours_param.value.indexOf(',') >= 0){ Hours_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Hours_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Hours_unit.options[Hours_unit.selectedIndex].value.split('|');",
"Hours = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"if (UF_Vol_param.value.indexOf(',') >= 0){ UF_Vol_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(UF_Vol_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = UF_Vol_unit.options[UF_Vol_unit.selectedIndex].value.split('|');",
"UF_Vol = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"if (Weight_Post_param.value.indexOf(',') >= 0){ Weight_Post_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Weight_Post_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Weight_Post_unit.options[Weight_Post_unit.selectedIndex].value.split('|');",
"Weight_Post = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"dp = decpts.options[decpts.selectedIndex].text;",
"KtV_Daugirdas =  -ln((BUN_Post / BUN_Pre) - (0.008 * Hours)) + ((4 - (3.5 * BUN_Post / BUN_Pre)) * UF_Vol / Weight_Post);",
"",
"if (doCalc) KtV_Daugirdas_param.value = fixDP(KtV_Daugirdas, dp);",
"",
"",
"",
"",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.Kt_V_Daugirdas_form){",
"",
"if (BUN_Pre_param.value && BUN_Pre < 0) {",
"BUN_Pre = 0;",
"BUN_Pre_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for BUN Pre is 0 mg/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (BUN_Pre_param.value && BUN_Pre > 300) {",
"BUN_Pre_param.value = \"\";",
"clrResults();",
"BUN_Pre = 0;",
"doCalc = false;",
"alert(\"The maximum value for BUN Pre is 300 mg/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (BUN_Post_param.value && BUN_Post < 0) {",
"BUN_Post = 0;",
"BUN_Post_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for BUN Post is 0 mg/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (BUN_Post_param.value && BUN_Post > 300) {",
"BUN_Post_param.value = \"\";",
"clrResults();",
"BUN_Post = 0;",
"doCalc = false;",
"alert(\"The maximum value for BUN Post is 300 mg/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.Kt_V_Daugirdas_form){",
"",
"KtV_Daugirdas_param.value = '';",
"",
"",
"}",
"",
"}",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"/* ]]> */"].join("\n");
