"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Osteoporosis (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/osteoporosis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H483055778\">",
"      <span class=\"h1\">",
"       What is osteoporosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Osteoporosis is a disease that makes your bones weak. People with the disease can break their bones too easily. For instance, people with osteoporosis sometimes break a bone after falling down at home.",
"     </p>",
"     <p>",
"      Breaking a bone can be serious, especially if the bone is in the hip. People who break a hip sometimes lose the ability to walk on their own. Many of them end up in a nursing home. That&rsquo;s why it is so important to avoid breaking a bone in the first place.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483055785\">",
"      <span class=\"h1\">",
"       How do I know if I have osteoporosis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Osteoporosis does not cause symptoms until you break a bone. But your doctor or nurse can have you tested for it. The best test is a bone density test called the &ldquo;DXA test.&rdquo; It is a special kind of X-ray.",
"     </p>",
"     <p>",
"      Experts recommend bone density testing for women older than 65. That is because women in this age group have the highest risk of osteoporosis. Still, other people should sometimes be tested, too. Ask your doctor or nurse if you should be tested.",
"     </p>",
"     <p>",
"      Some people learn that they have osteoporosis because they break a bone during a fall or a mild impact. This is called a &ldquo;fragility fracture,&rdquo; because people with healthy bones should not break a bone that easily. People who have fragility fractures are at high risk of having other bones break.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483055792\">",
"      <span class=\"h1\">",
"       What can I do to keep my bones as healthy as possible?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Eat foods with a lot of calcium, such as milk, yogurt, and green leafy vegetables (",
"        <a class=\"graphic graphic_table graphicRef67824 \" href=\"mobipreview.htm?28/58/29611\">",
"         table 1",
"        </a>",
"        and",
"        <a class=\"graphic graphic_figure graphicRef79375 \" href=\"mobipreview.htm?18/13/18647\">",
"         figure 1",
"        </a>",
"        )",
"       </li>",
"       <li>",
"        Eat foods with a lot of vitamin D, such as milk that has vitamin D added, and fish from the ocean",
"       </li>",
"       <li>",
"        Take calcium and vitamin D pills",
"       </li>",
"       <li>",
"        Be active for at least 30 minutes, most days of the week",
"       </li>",
"       <li>",
"        Avoid smoking",
"       </li>",
"       <li>",
"        Limit the amount of alcohol you drink to 1 to 2 drinks a day at most",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483055799\">",
"      <span class=\"h1\">",
"       Do your best to keep from falling, too",
"      </span>",
"      &nbsp;&mdash;&nbsp;It sounds simple, but you can prevent a lot of fractures by reducing the chances of a fall. To do that:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Make sure all your rugs have a no-slip backing to keep them in place",
"       </li>",
"       <li>",
"        Tuck away any electrical cords, so they are not in your way",
"       </li>",
"       <li>",
"        Light all walkways well",
"       </li>",
"       <li>",
"        Watch out for slippery floors",
"       </li>",
"       <li>",
"        Wear sturdy, comfortable shoes with rubber soles",
"       </li>",
"       <li>",
"        Have your eyes checked",
"       </li>",
"       <li>",
"        Ask your doctor or nurse to check whether any of your medicines might make you dizzy or increase your risk of falling",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483055806\">",
"      <span class=\"h1\">",
"       Can osteoporosis be treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, there are a few medicines to treat osteoporosis. These medicines can reduce the chances that you will break a bone.",
"     </p>",
"     <p>",
"      Doctors and nurses usually suggest trying medicines called bisphosphonates first. If those medicines do not do enough or if they cause side effects that you cannot stand, there are other medicines to try.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483055813\">",
"      <span class=\"h1\">",
"       How will I know the treatment is working?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors and nurses often order bone density tests to check if osteoporosis medicines are working. These are the same tests they use to find osteoporosis in the first place. Sometimes a blood or urine test is also needed.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H483055820\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
