var title_f34_58_35755="Rx fibromyalgia chronic fatigue";
var content_f34_58_35755=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F53766&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F53766&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Therapeutic plan for fibromyalgia or chronic fatigue syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Step one: patient and family education",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Validate the diagnosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Educate about prognosis, pathophysiology, treatment principles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Step two: medication trial",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tricyclic antidepressant or similar medications: low-dose at bedtime.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If no response, consider adding a serotonin-receptor inhibitor in the morning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If repetitive limb movement is suspected, trial with low dose benzodiazepine at bedtime",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Analgesics, NSAIDs may be useful to decrease pain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Step three: nonmedicinal treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Physical therapy, massage, myofascial release",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiovascular fitness training",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Trigger point or tender point injections",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Step four: specialized evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sleep center, if suspect sleep apnea or nocturnal myoclonus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mental health professional, if suspect major depression or panic disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pain or rehabilitation clinic",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
