var title_f34_58_35756="CHD likelihood with chest pain";
var content_f34_58_35756=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F51033&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F51033&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Likelihood of acute coronary syndrome secondary to coronary heart disease in patients without ST-segment elevation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        High likelihood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Any of the following features:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Primary symptom is pain or discomfort in chest or left arm",
"        <strong>",
"         AND",
"        </strong>",
"        current pain  is similar to pain of prior documented angina/MI",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Patient has known CHD",
"        <strong>",
"         OR",
"        </strong>",
"        MI",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Transient mitral regurgitation",
"        <strong>",
"         OR",
"        </strong>",
"        hypotension",
"        <strong>",
"         OR",
"        </strong>",
"        diaphoresis",
"        <strong>",
"         OR",
"        </strong>",
"        pulmonary edema",
"        <strong>",
"         OR",
"        </strong>",
"        rales",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        New (or presumably new) transient ST deviation (&ge;1 mm)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        New T-wave inversion in multiple precordial leads",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Elevated cardiac troponin or CK-MB levels",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Intermediate likelihood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Absence of high likelihood features and presence of any of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Primary symptom is pain or discomfort in chest or left arm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Older than 70 years of age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Male",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Diabetes mellitus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Extracardiac vascular disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fixed Q waves",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        ST depression 0.5 to 1 mm or T-wave inversion &gt;1 mm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Normal cardiac troponin or CK-MB levels",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Low likelihood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Absence of high or intermediate likelihood features. May have any of the following and still be low likelihood:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        History of symptoms that are probably ischemic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Recent use of cocaine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        T-wave flattening or inversion &lt;1 mm",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Note: T-wave inversion refers to a T-wave with opposite polarity to the dominant QRS in that lead.",
"    <div class=\"footnotes\">",
"     CK-MB: creatine kinase MB fraction; MI: myocardial infarction; CHD: coronary heart disease.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Anderson J, Adams C, Antman E, et al. ACC/AHA 2007 guidelines for the management of patients with unstable angina/non-ST-elevation myocardial infarction: a report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing Committee to revise the 2002 Guidelines for the Management of Patients with Unstable Angina/Non-ST-Elevation).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
